!===========================================================================
! *def oh3_pes
!  1. Main PES program for calculating:
!     energies and gradients for diabatic states and diabatic couplings
!     energies, gradients and non-adiabatic couplings for adiabatic states 
!  2. The input file: ****.xyz (**** is a file name, for example, OH3;) 
!     !!!THE UNIT SHOULD BE ANGSTROM !!!
!     the format of ****.xyz should be a standard xyz format that is readbale
!     by Molden with 3 hydrogen atoms first, the oxygen at last, for example: 
!     4
!    
!     H  X Y Z 
!     H  X Y Z
!     H  X Y Z
!     O  X Y Z
!  3. Executing the program with the input, the program will generate 2 output 
!     they correspond to: ****.out and ****.tmp
!     ****.out has a detailed print out of energies, gradients and nonadiabatic 
!     couplings
!     ****.tmp has a three line simple  print of diabatic states, diabatic
!     couplings and
!     adiabatic states in the following format
!     u(1,1) u(2,2) u(3,3)
!     u(1,2) u(1,3) u(2,3)
!     a(1)   a(2)   a(3)
!  4. The zero of energy is: -76.80042447 hartree
!
!  ==========================definition of variables========================
!
!  4. xyz: the xyz coordinate
!          unit: in angstroms
!          xyz is a 4 by 3 matrix
!  5.  u : the diabatic matrix
!          unit: in hartrees
!          u is a 3 by 3 matrix
!          notice u(i,j)=u(j,i) for i not equal to j 
!          the diabatic states are diagonal elements of u 
!          the diabatic couplings are off-diagonal elements of u 
!  6.  gu: the gradients of diabatic matrix w.r.t. the xyz coordinates
!          unit: in hartrees/angstrom
!          gu is a 4 by 3 by 3 by 3 matrix
!          "gu(:,:,i,j)" is the gradient of u(i,j)
!  7.  a : the adiabatic states
!          unit: in hartrees
!          a is a 3 element vector 
!  8.  ga: the gradient of adiabatic states w.r.t. the xyz coordinates
!          unit: in hartrees/angstrom
!          ga is a 4 by 3 by 3 matrix
!          "ga(:,:,1)" is the gradient of the ground adiabatic state
!          "ga(:,:,2)" is the gradient of the first excited adiabatic state
!          "ga(:,:,3)" is the gradient of the second excited adiabatic state
!  9.  f : the non-adiabatic couplings
!          unit: in angstrom**(-1)
!          f is a 4 by 3 by 3 by 3 matrix
!          "f(:,:,i,j)" is the non-adiabatic coupling of state i and j
!          f(:,:,i,j)=-f(:,:,j,i), and f(:,:,i,i)=0 
!  10. rv: the diabatic to adiabatic rotation matrix 
!===========================================================================


  subroutine pes(x,igrad,p,g,d)

  implicit none
  ! number of electronic state
  integer, parameter :: nstates=3
  integer, parameter :: natoms=4
  integer, intent(in) :: igrad
  double precision, intent(in) :: x(natoms,3)
  double precision, intent(out) :: p(nstates), g(nstates,natoms,3)
  double precision, intent(out) :: d(nstates,nstates,natoms,3) 

  character (len=1) :: symb
  integer :: iatom,idir,istate,jstate
  integer :: i,j,k,l
  real*8 :: u11, u22, u33
  real*8 :: u12, u13, u23
  real*8 :: s12, s23
  real*8 :: xyz(4,3)
  character(len=32)::fname, bname
  real*8 :: du11dx(4,3), du22dx(4,3), du33dx(4,3)
  real*8 :: du12dx(4,3), du13dx(4,3), du23dx(4,3)
  real*8 :: gu(4,3,3,3)
  real*8 :: u(3,3),rv(3,3),a(3)
  real*8 :: ga(4,3,3),f(4,3,3,3)
  real*8 :: tmpgu(3,3),tmpga(3,3)


   xyz=x

!compute diabatic states
  call u11_prepot_8
  call u11_pot_8(xyz,u11,du11dx)
  call u22_prepot_8
  call u22_pot_8(xyz,u22,du22dx)
  call u33_prepot_8
  call u33_pot_8(xyz,u33,du33dx)

!compute diabatic couplings
  call u12_order10
  call u13_order12
  call u23_order10
  call u12_dc_10(xyz,u12,s12)
  call u13_dc_12(xyz,u13)
  call u23_dc_10(xyz,u23,s23)

!compute the adiabatic states and eigenvectors
  u(1,1)=u11
  u(1,2)=u12
  u(1,3)=u13
  u(2,1)=u12
  u(2,2)=u22
  u(2,3)=u23
  u(3,1)=u13
  u(3,2)=u23
  u(3,3)=u33
  call dsyevj3(u,rv,a)
  call order(a,rv)


  p=(a+76.80042447)*27.211386

  if (igrad.ne.0) then 

  !compute diabatic couplings derivatives
  call u12_dvdx(xyz,u12,s12,du12dx)
  call u13_dvdx(xyz,u13,du13dx)
  call u23_dvdx(xyz,u23,s23,du23dx)

  !assign dudx to gu

  do i=1,4
  do j=1,3
  gu(i,j,1,1)=du11dx(i,j)
  gu(i,j,1,2)=du12dx(i,j)
  gu(i,j,1,3)=du13dx(i,j)
  gu(i,j,2,1)=du12dx(i,j)
  gu(i,j,2,2)=du22dx(i,j)
  gu(i,j,2,3)=du23dx(i,j)
  gu(i,j,3,1)=du13dx(i,j)
  gu(i,j,3,2)=du23dx(i,j)
  gu(i,j,3,3)=du33dx(i,j)
  enddo
  enddo

!initialize the ga and f matrices
  do i=1,4
  do j=1,3
  do k=1,3
  do l=1,3
  ga(i,j,k)=0.000
  f(i,j,k,l)=0.000
  enddo
  enddo
  enddo
  enddo

!compute the adiabatic states gradients,nonadiabatic coupling vectors
  do i=1,4
  do j=1,3
  tmpgu(1,1)=du11dx(i,j)
  tmpgu(1,2)=du12dx(i,j)
  tmpgu(1,3)=du13dx(i,j)
  tmpgu(2,1)=du12dx(i,j)
  tmpgu(2,2)=du22dx(i,j)
  tmpgu(2,3)=du23dx(i,j)
  tmpgu(3,1)=du13dx(i,j)
  tmpgu(3,2)=du23dx(i,j)
  tmpgu(3,3)=du33dx(i,j)
  !C^T*dU*C
  tmpga = matmul(transpose(rv), matmul(tmpgu, rv))
  !dV_i = (C^T*dU*C)_ii
  do k=1,3
  ga(i,j,k)=tmpga(k,k)
  enddo
  !F_ij = (C^T*dU*C)_ij / (V_j-V_i)
  do k=1,2
  do l=k+1,3
  f(i,j,k,l)=tmpga(k,l)/(a(l)-a(k))
  f(i,j,l,k)=-f(i,j,k,l)
  enddo
  enddo
  enddo
  enddo

    do iatom=1,4
    do idir=1,3
    do istate=1,3
      g(istate,iatom,idir)=ga(iatom,idir,istate)*27.211386
    enddo
    enddo
    enddo 

    do iatom=1,4
    do idir=1,3
    do istate=1,3
    do jstate=1,3
      d(istate,jstate,iatom,idir)=f(iatom,idir,istate,jstate)
    enddo
    enddo
    enddo
    enddo

  endif 

end

!===========================================================================
! *def DSYEVJ3(A, Q, W)
!  subroutine of diagonalizing a 3 by 3 matrix
!  A is the input matirx
!  Q is the eigenvector matrix
!  W is the eigenvalue
!===========================================================================
SUBROUTINE DSYEVJ3(A, Q, W)
      DOUBLE PRECISION A(3,3)
      DOUBLE PRECISION Q(3,3)
      DOUBLE PRECISION W(3)

      INTEGER          N
      PARAMETER        ( N = 3 )
    
      DOUBLE PRECISION SD, SO
      DOUBLE PRECISION S, C, T
      DOUBLE PRECISION G, H, Z, THETA
      DOUBLE PRECISION THRESH
      INTEGER          I, X, Y, R

      DO 10 X = 1, N
        Q(X,X) = 1.0D0
        DO 11, Y = 1, X-1
          Q(X, Y) = 0.0D0
          Q(Y, X) = 0.0D0
   11   CONTINUE
   10 CONTINUE

      DO 20 X = 1, N
        W(X) = A(X, X)
   20 CONTINUE

      SD = 0.0D0
      DO 30 X = 1, N
        SD = SD + ABS(W(X))
   30 CONTINUE
      SD = SD**2
 
      DO 40 I = 1, 50
        SO = 0.0D0
        DO 50 X = 1, N
          DO 51 Y = X+1, N
            SO = SO + ABS(A(X, Y))
   51     CONTINUE
   50   CONTINUE
        IF (SO .EQ. 0.0D0) THEN
          RETURN
        END IF

        IF (I .LT. 4) THEN
          THRESH = 0.2D0 * SO / N**2
        ELSE
          THRESH = 0.0D0
        END IF

        DO 60 X = 1, N
          DO 61 Y = X+1, N
            G = 100.0D0 * ( ABS(A(X, Y)) )
            IF ( I .GT. 4 .AND. ABS(W(X)) + G .EQ. ABS(W(X)) .AND. ABS(W(Y)) + G .EQ. ABS(W(Y)) ) THEN
              A(X, Y) = 0.0D0
            ELSE IF (ABS(A(X, Y)) .GT. THRESH) THEN
              H = W(Y) - W(X)
              IF ( ABS(H) + G .EQ. ABS(H) ) THEN
                T = A(X, Y) / H
              ELSE
                THETA = 0.5D0 * H / A(X, Y)
                IF (THETA .LT. 0.0D0) THEN
                  T = -1.0D0 / (SQRT(1.0D0 + THETA**2) - THETA)
                ELSE
                  T = 1.0D0 / (SQRT(1.0D0 + THETA**2) + THETA)
                END IF
              END IF

              C = 1.0D0 / SQRT( 1.0D0 + T**2 )
              S = T * C
              Z = T * A(X, Y)
              
              A(X, Y) = 0.0D0
              W(X)    = W(X) - Z
              W(Y)    = W(Y) + Z
              DO 70 R = 1, X-1
                T       = A(R, X)
                A(R, X) = C * T - S * A(R, Y)
                A(R, Y) = S * T + C * A(R, Y)
   70         CONTINUE
              DO 80, R = X+1, Y-1
                T       = A(X, R)
                A(X, R) = C * T - S * A(R, Y)
                A(R, Y) = S * T + C * A(R, Y)
   80         CONTINUE
              DO 90, R = Y+1, N
                T       = A(X, R)
                A(X, R) = C * T - S * A(Y, R)
                A(Y, R) = S * T + C * A(Y, R)
   90         CONTINUE

              DO 100, R = 1, N
                T       = Q(R, X)
                Q(R, X) = C * T - S * Q(R, Y)
                Q(R, Y) = S * T + C * Q(R, Y)
  100         CONTINUE
            END IF
   61     CONTINUE
   60   CONTINUE
   40 CONTINUE

      PRINT *, "DSYEVJ3: No convergence."
            
END SUBROUTINE

!===========================================================================
! *def order(a,rv)
!  subroutine of ordering three eigenstates
!  a is the eigenvalue
!  rv is the eigenvector
!===========================================================================
subroutine order(a,rv)
double precision a(3)
double precision rv(3,3)
double precision tmpv(3,3)
double precision s0, s1, s2
integer i, j

do i=1,3
do j=1,3
tmpv(i,j)=rv(i,j)
enddo
enddo

    if (a(1) < a(2)) then
      if (a(1) < a(3)) then
        if (a(2) < a(3)) then
          s0=a(1)
          s1=a(2)
          s2=a(3)
          do i=1,3
            rv(i,1)=tmpv(i,1)
          enddo
          do i=1,3
            rv(i,2)=tmpv(i,2)
          enddo
          do i=1,3
            rv(i,3)=tmpv(i,3)
          enddo
        else
          s0=a(1)
          s1=a(3)
          s2=a(2)
          do i=1,3
            rv(i,1)=tmpv(i,1)
          enddo
          do i=1,3
            rv(i,2)=tmpv(i,3)
          enddo
          do i=1,3
            rv(i,3)=tmpv(i,2)
          enddo
        end if
      else
          s0=a(3)
          s1=a(1)
          s2=a(2)
          do i=1,3
            rv(i,1)=tmpv(i,3)
          enddo
          do i=1,3
            rv(i,2)=tmpv(i,1)
          enddo
          do i=1,3
            rv(i,3)=tmpv(i,2)
          enddo
      end if
    else
      if (a(2) < a(3)) then
        if (a(1) < a(3)) then
          s0=a(2)
          s1=a(1)
          s2=a(3)
          do i=1,3
            rv(i,1)=tmpv(i,2)
          enddo
          do i=1,3
            rv(i,2)=tmpv(i,1)
          enddo
          do i=1,3
            rv(i,3)=tmpv(i,3)
          enddo
        else
          s0=a(2)
          s1=a(3)
          s2=a(1)
          do i=1,3
            rv(i,1)=tmpv(i,2)
          enddo
          do i=1,3
            rv(i,2)=tmpv(i,3)
          enddo
          do i=1,3
            rv(i,3)=tmpv(i,1)
          enddo
        end if
      else
          s0=a(3)
          s1=a(2)
          s2=a(1)
          do i=1,3
            rv(i,1)=tmpv(i,3)
          enddo
          do i=1,3
            rv(i,2)=tmpv(i,2)
          enddo
          do i=1,3
            rv(i,3)=tmpv(i,1)
          enddo
      end if
    end if

a(1)=s0
a(2)=s1
a(3)=s2
end subroutine
!===========================================================================
! *def u12_dvdx(xyz,u12,s12,du12dx)
!  main subtoutine of evaluating derivative of u12 w.r.t. the xyz coordinates
!  xyz is the coordinate
!  u12 is u12
!  s12 is u12 devided by the hyperbolic function
!  du12dx is the gradient of u12
!===========================================================================
subroutine u12_dvdx(xyz,u12,s12,du12dx)
implicit none
integer, parameter:: dp=kind(0.d0)   
integer :: i,j,k
real(dp) :: du12dx(4,3),xyz(4,3)
real(dp) :: u12,s12
real(dp) :: coord(12), r(6)
real(dp) :: dudx(12)
real(dp) :: dvdx(12), dvdr(6), drdx(6,12)
real(dp) :: dtdx(12)
real(dp) :: volume

! Initialize dVdX(12)
      do i=1,12
        dVdX(i)=0.0d0
      enddo

! Initialize dRdX(6,12)
      do i=1,6
        do j=1,12
          dRdX(i,j)=0.0d0
        enddo
      enddo

! Initialize dVdR(6)
      do i=1,6
        dVdR(i)=0.0d0
      enddo

! Assign xyz to coord
      do i=1,4
      do j=1,3
        k=3*(i-1)+j
        coord(k)=xyz(i,j)
      enddo
      enddo

! Compute distances r
r(1)=sqrt((xyz(1,1)-xyz(2,1))**2+(xyz(1,2)-xyz(2,2))**2+(xyz(1,3)-xyz(2,3))**2)
r(2)=sqrt((xyz(1,1)-xyz(3,1))**2+(xyz(1,2)-xyz(3,2))**2+(xyz(1,3)-xyz(3,3))**2)
r(3)=sqrt((xyz(1,1)-xyz(4,1))**2+(xyz(1,2)-xyz(4,2))**2+(xyz(1,3)-xyz(4,3))**2)
r(4)=sqrt((xyz(2,1)-xyz(3,1))**2+(xyz(2,2)-xyz(3,2))**2+(xyz(2,3)-xyz(3,3))**2)
r(5)=sqrt((xyz(2,1)-xyz(4,1))**2+(xyz(2,2)-xyz(4,2))**2+(xyz(2,3)-xyz(4,3))**2)
r(6)=sqrt((xyz(3,1)-xyz(4,1))**2+(xyz(3,2)-xyz(4,2))**2+(xyz(3,3)-xyz(4,3))**2)

! Call EvdVdR to evaluate dVdR(6)
      Call EvU12O10dVdR(coord,r,dvdr)

! Call EvdRdX to evaluate dRdX(6,12)
      Call EvdRdX(coord,r,drdx)

! Calculate dVdX by using chain rule: dV/dXi=(dV/dRj)*(dRj/dXi), j=1 to 6
      do i=1,12
        do j=1,6
          dVdX(i)=dVdX(i) + dVdR(j)*dRdX(j,i)
        enddo
      enddo

      do i=1,12
          dVdX(i)=dVdX(i)/627.509474
      enddo

  call P_volume(xyz,volume)

! Now compute numerical dtdx
  call Num_dtdx(xyz,dtdx)

! Chain rule again, because U=tanh*V
! dUdX=dtanhdX*V+tanh*dVdX
do i=1,12
  dudx(i)=0
enddo

do i=1,12
  dudx(i)=dtdx(i)*s12+volume*dvdx(i)
enddo


! Assign dvdx back to du12dx
      do i=1,4
      do j=1,3
        k=3*(i-1)+j
        du12dx(i,j)=dudx(k)
      enddo
      enddo

      return

end subroutine u12_dvdx 

