entry u23_dc_10(xyz,v,s)

r12=sqrt((xyz(1,1)-xyz(2,1))**2+(xyz(1,2)-xyz(2,2))**2+(xyz(1,3)-xyz(2,3))**2)
r13=sqrt((xyz(1,1)-xyz(3,1))**2+(xyz(1,2)-xyz(3,2))**2+(xyz(1,3)-xyz(3,3))**2)
r14=sqrt((xyz(1,1)-xyz(4,1))**2+(xyz(1,2)-xyz(4,2))**2+(xyz(1,3)-xyz(4,3))**2)
r23=sqrt((xyz(2,1)-xyz(3,1))**2+(xyz(2,2)-xyz(3,2))**2+(xyz(2,3)-xyz(3,3))**2)
r24=sqrt((xyz(2,1)-xyz(4,1))**2+(xyz(2,2)-xyz(4,2))**2+(xyz(2,3)-xyz(4,3))**2)
r34=sqrt((xyz(3,1)-xyz(4,1))**2+(xyz(3,2)-xyz(4,2))**2+(xyz(3,3)-xyz(4,3))**2)

!x(1)=exp(-((r12-ra1))/a1)
!x(2)=exp(-((r13-ra1))/a1)
!x(3)=exp(-((r14-ra2))/a2)
!x(4)=exp(-((r23-ra1))/a1)
!x(5)=exp(-((r24-ra2))/a2)
!x(6)=exp(-((r34-ra2))/a2)
 
x(1)=exp(-((r12-ra1))/a1 -((r12-rb1)**2)/b1)
x(2)=exp(-((r13-ra1))/a1 -((r13-rb1)**2)/b1)
x(3)=exp(-((r14-ra2))/a2 -((r14-rb2)**2)/b2)
x(4)=exp(-((r23-ra1))/a1 -((r23-rb1)**2)/b1)
x(5)=exp(-((r24-ra2))/a2 -((r24-rb2)**2)/b2)
x(6)=exp(-((r34-ra2))/a2 -((r34-rb2)**2)/b2)

do i=1,3
do j=1,3
rrel(i,j)=xyz(i,j)-xyz(4,j)
enddo
enddo

!compute r2xr3
cross(1)=rrel(2,2)*rrel(3,3)-rrel(2,3)*rrel(3,2)
cross(2)=-rrel(2,1)*rrel(3,3)+rrel(2,3)*rrel(3,1)
cross(3)=rrel(2,1)*rrel(3,2)-rrel(2,2)*rrel(3,1)
!compute p*r1*(r2xr3)
volume=0.00000
do i=1,3
volume=volume+rrel(1,i)*cross(i)
enddo
volume=tanh(15.4*volume)

call ev_pol_con_10(x,q)
v=dot_product(coeff,q)*volume/627.509474
s=dot_product(coeff,q)/627.509474

end  subroutine

