real*8 function ohstar_alt(r)
implicit none
integer, parameter:: dp=kind(0.d0)                   ! double precision
real(dp), intent(in) :: r
integer :: i
real(dp) :: alr, blr, vsr, vlr, fs, d3bj_oh
real(dp), dimension(3) :: plr, clr
real(dp) :: asr, bsr
real(dp), dimension(6) :: psr, csr

asr = 0.22510201499513907
bsr = 2.2657615066074954

csr(1) = 0.35455513969718444    
csr(2) = -0.52912871421810181     
csr(3) = -6.0697181582250126E-002
csr(4) = 0.47976112924154690     
csr(5) = 2.3310416022954366     
csr(6) = 5.6903894590457540

do i = 1, 6
    psr(i) = exp(-asr*bsr**(i-1)*r**2)
end do

vsr = dot_product(csr, psr)


fs = 0.5_dp*(1.0_dp - tanh(1250.0_dp*(r-1.177_dp)))

ohstar_alt = fs*vsr + (1.0_dp - fs)*d3bj_oh(r)

end function ohstar_alt

real*8 function grad_ohstar_alt(r)
implicit none
integer, parameter:: dp=kind(0.d0)                   ! double precision
