gfs = -0.5_dp*1250.0_dp/(cosh(1250.0_dp*(r-1.177_dp)))**2

grad_ohstar_alt = gfs*(vsr - d3bj_oh(r)) + fs*gsr + (1.0_dp - fs)*grad_d3bj_oh(r)

end function grad_ohstar_alt
